  value={this.state.value2}
  onValueChange={value => this.setState({ value2: value })}
  stepValue={5}
  minIconName="ios-thumbs-down"
  maxIconName="ios-thumbs-up"
  minIconSize={20}
  maxIconSize={20}
/>
